import { useDispatch } from 'react-redux';
import { NavLink } from 'react-router-dom';
import pokeballs_bg from '../video/pokeballs_bg.png';
import {getPokemons} from '../reducer/actions'
import './styles/LandingPage.css'

export default function LandingPage(){
    const dispatch = useDispatch()
    return(
        <div className="lp">
            <h1 className='titleLp'>Pokemon</h1>
            <img className="bg" src={pokeballs_bg}/>
            <div className="infoDiv">
                <p>Busca informacion de tus Pokemons favoritos o crea nuevos</p>
                <NavLink exact to='/home'>
                    <button className='btnEmpezar' 
                    OnClick={() => dispatch(getPokemons())}>
                        Empezar
                    </button>  
                </NavLink>
            </div>
        </div>
    )
}
